import React from 'react';
import { Card } from 'react-bootstrap';

function ServerItem({ server, selected, onClick }) {
    const { id, name, ip, port  } = server;
    const handleClick = () => {
        onClick(id);
    };
    return (
        <Card
            className={`server-item ${selected ? 'selected' : ''}`}
            onClick={handleClick}
        >
            <Card.Body>
                <Card.Title>{name}</Card.Title>
                <Card.Subtitle className="mb-2 text-muted">{ip}</Card.Subtitle>
                <Card.Text>{`Порт: ${port}`}</Card.Text>
            </Card.Body>
        </Card>
    );
}

export default ServerItem;
